import React, { useState } from "react";
import DetermineCommunity from "./DetermineCommunity";
import { Link } from "react-router-dom";

function Community() {
  const data = [
    { graphName: "Graph 1", stsName: "Tuning Set 1" },
    { graphName: "Graph 2", stsName: "Tuning Set 1" },
    { graphName: "Graph 3", stsName: "Tuning Set 2" },
    { graphName: "Graph 1", stsName: "Tuning Set 1" },
    { graphName: "Graph 2", stsName: "Tuning Set 1" },
    { graphName: "Graph 3", stsName: "Tuning Set 2" },
  ];

  const [determineCommunity, setDetermineCommunity] = useState(null);
  const [refineCommunity, setRefineCommunity] = useState(null);

  const handleDetermineCommunity = (event) => {
    event.preventDefault();
    setDetermineCommunity(true);
  };

  const handleRefineCommunity = (event) => {
    event.preventDefault();

    //setRefineCommunity(true);
  };

  const renderTableData = () => {
    return data.map((dra, index) => {
      const { graphName, stsName } = dra;

      let determineCommunity = (
        <button className="btn" onClick={handleDetermineCommunity}>
          Community Detection
        </button>
      );

      let modifyCommunity = (
        <button className="btn-red" onClick={handleRefineCommunity}>
          Refine Community
        </button>
      );

      return (
        <tr key={index}>
          <td>{graphName}</td>
          <td>{stsName}</td>
          <td>
            {determineCommunity} &emsp; &emsp; &emsp;{modifyCommunity}
          </td>
        </tr>
      );
    });
  };

  return (
    <div className="form-container">
      <div className="form">
        <h4>Community</h4>
        <br />
        <br />
        <br />
        <table className="table">
          <thead>
            <tr className="tr">
              <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
                Graph Name
              </th>
              <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
                STS Name
              </th>
              <th style={{ backgroundColor: "#41afca", color: "#f1f5f9" }}>
                Actions
              </th>
            </tr>
          </thead>
          <tbody>{renderTableData()}</tbody>
        </table>
      </div>
      {determineCommunity !== null && (
        <div className="modal">
          <div className="modal-content auto">
            <button
              className="btn-cross"
              onClick={() => setDetermineCommunity(null)}
            >
              X
            </button>
            <DetermineCommunity />
          </div>
        </div>
      )}
      {/* {refineCommunity !== null && (
        <div className="modal">
          <div className="modal-content">
            <button
              className="btn-cross"
              onClick={() => setRefineCommunity(null)}
            >
              X
            </button>
            <th>Refine Community by Affinity:</th>
            <Link to="/refine-community">
              <button
                className="btn-cross btn-cross-form"
                onClick={() => setRefineCommunity(null)}
              >
                X
              </button>
            </Link>

            <button
              className="btn"
              style={{
                width: "140px",
                height: "40px",
                margin: "20px 20px 20px 200px",
              }}
              onClick={() => setRefineCommunity(null)}
            >
              OK
            </button>
          </div>
        </div>
      )} */}
    </div>
  );
}

export default Community;
